import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import AppHeader from "./components/AppHeader";
import TodoApp from "./pages/TodoApp";
import TodoDetails from "./pages/TodoDetails";
import TodoEdit from "./pages/TodoEdit";
import UserDetails from "./pages/UserDetails";
import UserLogin from "./pages/UserLogin";
import CarsForSale from "./pages/CarsForSale";
import PurchasePage from "./pages/PurchasePage";
import AddCar from "./components/AddCar"; // תיקון הייבוא
import "./styles/main.css";

function App() {
  const [user, setUser] = useState(null);

  const handleLogin = (userData) => {
    setUser(userData);
  };

  return (
    <Router>
      <AppHeader user={user} />
      <main>
        <Routes>
          <Route path="/user" element={<UserLogin onLogin={handleLogin} />} />
          <Route path="/" element={<TodoApp />} />
          <Route path="/todo/:id" element={<TodoDetails />} />
          <Route path="/todo/edit/:id?" element={<TodoEdit />} />
          <Route path="/cars-for-sale" element={<CarsForSale />} />
          <Route path="/user" element={<UserDetails />} />
          <Route path="/purchase" element={<PurchasePage />} />
        </Routes>
      </main>
    </Router>
  );
}

export default App;
